[asy]
Label f;

f.p=fontsize(6);

xaxis(-10,10,Arrows(4));

yaxis(-3,3,Arrows(4));

real f(real x)

{

return 2x/(x^2-5x-14);

}

draw(graph(f,-10,-2.1),red,Arrows(4));
draw(graph(f,-1.9,6.9),red,Arrows(4));
draw(graph(f,7.1,10),red,Arrows(4));
draw((-2,-3)--(-2,3),dashed);
draw((6,-3)--(6,3),dashed);
label("$x$",(10,0),E);
label("$y$",(0,3),N);
label("$a$",(-2,0),S);
label("$b$",(6,0),S);
label("$c$",(-2,2),W);
[/asy]

