शंकु का आयतन $V = \frac{1}{3}Bh$ है, जहाँ $B$ आधार का क्षेत्रफल और $h$ शंकु की ऊँचाई है। दिया गया है कि आधार का क्षेत्रफल 30 वर्ग इकाई है और शंकु की ऊँचाई 6.5 इकाई है। इसलिए, शंकु का आयतन $V = \frac{1}{3} \times 30 \times 6.5 = 65$ घन इकाई है। इसलिए, शंकु के आयतन में 65 घन इकाई हैं।  \[
\boxed{65}
\]

